import React from "react";
import vid from "../videos/gymvid3.mp4"

export default function About(){

    return(
        <div className="about">

           <div className="about--text">
                <h1>About Us</h1>
                <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Quam hic mollitia doloremque, ducimus voluptatum inventore earum a, fugiat veritatis laboriosam explicabo at deleniti eligendi cor</p>
           </div>

           <div className="about--vid">
             <video  width="640" height="360"  src={vid} />
                
              
           </div>
        </div>
    )
}
